INSERT INTO host VALUES(2, 'pic2.jpg', 'SK', '', 76000, '2021-01-02', '명함2.jpg', 'SK의 모든 구성원은 SKMS에 대한 확신과 열정을 가지고 자발적 · 의욕적으로 이를 실천하고 있습니다.', '2020-04-02');
INSERT INTO host VALUES(3, 'pic3.jpg', '쿠팡', '', 95000, '2021-01-02', '명함3.jpg', '쿠팡은 고객이 쿠팡앱을 열어보는 순간부터 상품을 문 앞으로 배송받는 순간까지, 고객 한 분 한 분에게 감동을 줄 수 있도록 쇼핑의 경험을 새롭게 창조하고 있습니다.', '2020-04-02');
INSERT INTO host VALUES(4, 'pic4.jpg', '네이버', '', 47500, '2021-01-02', '명함4.jpg', '네이버(주)는 한국 최대 검색포털 네이버 뿐만 아니라, 전 세계 2억 명이 사용하고 있는 모바일 메신저 라인, 동영상 카메라 스노우, 디지털 만화 서비스 네이버웹툰 등을 서비스하고 있는 글로벌 ICT 기업입니다. 네이버는 인공지능, 로보틱스, 모빌리티 등 미래 기술에 대한 지속적인 연구개발을 통해 기술 플랫폼의 변화와 혁신을 추구하며 세계 각국의 수많은 이용자와 다양한 파트너들이 함께 성장할 수 있도록 노력하고 있습니다.', '2020-04-03');
INSERT INTO host VALUES(5, 'pic5.jpg', '카카오', '', 38000, '2021-01-02', '명함5.jpg', '우리는 카카오스러움에서 고민을 시작하고, 답을 찾을 것입니다.', '2020-04-04');
INSERT INTO host VALUES(6, 'pic6.jpg', '라인', '', 47500, '2021-01-02', '명함6.jpg', '라인은 언제나 사용자와 함께 합니다.', '2020-04-05');
